 evaluateConstraints = function evaluateConstraints(dimObj) {
    if (dimObj.stopOffs.length > constraints.resources[this.id].maxstops) return false;

    if(isMaxDistanceCrossed(dimObj,this.id))
	{
		return false;
	}


    if(isMaxDriveTimeCrossed(dimObj,this.id))
	{
		return false;
	}

	if(isMaxOutOfRouteMile(dimObj,this.id))
	{
		return false;
	}
	return true;
};

isMaxOutOfRouteMile = function isMaxOutOfRouteMile(dimObj,resourceid) {
    var totalDistance = distanceMatrix[sliceStopOffData(dimObj.stopOffs[0].stop)][sliceStopOffData(dimObj.stopOffs[dimObj.stopOffs.length - 1].stop)];
    var maxOutOfRouteMile = 0;
    if (constraints.resources[resourceid].maxoutofroutemilesunit == "%") {
        maxOutOfRouteMile = (((constraints.resources[resourceid].maxoutofroutemiles) / 100) * totalDistance) + totalDistance;
    } else {
        maxOutOfRouteMile = constraints.resources[resourceid].maxoutofroutemiles + totalDistance;
    }
    var totalDriveDistance = getTotalDriveDistance(dimObj);
    if (totalDriveDistance > maxOutOfRouteMile) {
        return true;
    }
    return false;
};

isMaxDistanceCrossed = function isMaxDistanceCrossed(dimObj,resourceid) {
    var totalDriveDistance = getTotalDriveDistance(dimObj);
    if (totalDriveDistance > constraints.resources[resourceid].maxdistanceinmiles) {
        return true;
    }
    return false;
};

isMaxDriveTimeCrossed = function isMaxDriveTimeCrossed(dimObj,resourceid) {
    var totalDriveTime = getTotalDriveTime(dimObj);
    if (totalDriveTime > constraints.resources[resourceid].maximum_single_hours) {
        return true;
    }
    return false;
};
getTotalDriveDistance = function getTotalDriveDistance(dimObj) {
    var totalDriveDistance = 0;
    for (var stopIndex = 0; stopIndex < (dimObj.stopOffs.length - 1); stopIndex++) {
        var stop1 = sliceStopOffData(dimObj.stopOffs[stopIndex].stop);
        var stop2 = sliceStopOffData(dimObj.stopOffs[stopIndex + 1].stop);
        totalDriveDistance = totalDriveDistance + (distanceMatrix[stop1][stop2]);
    }
    return totalDriveDistance;
};
getTotalDriveTime = function getTotalDriveTime(dimObj) {
    var totalDriveTime = 0;
    for (var stopIndex = 0; stopIndex < (dimObj.stopOffs.length - 1); stopIndex++) {
        var stop1 = sliceStopOffData(dimObj.stopOffs[stopIndex].stop);
        var stop2 = sliceStopOffData(dimObj.stopOffs[stopIndex + 1].stop);
        totalDriveTime = totalDriveTime + (transitTimeMatrix[stop1][stop2]);
    }
    return totalDriveTime;
};
sliceStopOffData = function sliceStopOffData(stopOffData) {
    var stop = stopOffData;
    if (stopOffData.indexOf('__') > 0) {
        stop = stopOffData.slice(0, stopOffData.indexOf('__'));
    }
    return stop;
};

